        var columns = [];
        var series = {};
        for (var i = 0; i < data.getNumberOfColumns(); i++) {
            columns.push(i);
            if (i > 0) {
                series[i - 1] = {};
            }
        }
        
        var options = {
            hAxis: {
                viewWindow: { min: new Date (2019, 11, 1), max: new Date (2020, 3, 29) }, 
                title: 'date'
            },
            vAxis: {
                title: 'story count',
                minorGridlines: {
                    color: 'transparent'
                }
            },
            width: 700,
            height: 400,
            legend: { position: 'right', maxLines: 3 },
            chartArea: {left:60, top:10, width:'70%', height:'75%'},
            series: series,
            
        };
        
        var chart = new google.visualization.LineChart(document.getElementById('chart_div'));
        
        var url_flag = true
        
        var selectHandler = function(e) {
            var selectedItem = chart.getSelection()[0];
            if (selectedItem) {
                // if row is null, we clicked on the legend
                if (selectedItem.row == null) {
                    var col = selectedItem.column;
                    //alert('Found ' + col + ' column');
                    if (columns[col] == col) {
                        // hide the data series
                        columns[col] = {
                            label: data.getColumnLabel(col),
                            type: data.getColumnType(col),
                            calc: function () {
                                return null;
                            }
                        };

                        // grey out the legend entry
                        series[col - 1].color = '#CCCCCC';
                    }
                    else {
                        // show the data series
                        columns[col] = col;
                        series[col - 1].color = null;
                    }
                    var view = new google.visualization.DataView(data);
                    view.setColumns([0, 1, 3, 5, 7, 9, 11]);
                    chart.draw(view, options);
                }
                else if (url_flag)
                {
                    data_row = selectedItem['row'];
                    graph_col = selectedItem['column'];
                    data_col = graph_col * 2 - 1;
                    var currVal = data.getValue(data_row, data_col);
                    //alert('Opening ' + currVal + ' JIRA issues in new window..');
                    window.open(data.getValue(data_row, data_col+1));
                }
            }
        }
        
        // Add our selection handler.
        google.visualization.events.addListener(chart, 'select', selectHandler);
        
        chart.draw(view, options);
        
    }
